import React from 'react';
import '../App.css';
import MovieCards from './MovieCard';

class MovieList extends React.Component {
  render() {
    const movieList = movies.map((movie) => movie);
    return (<MovieCards movies={ movieList } />);
  }
}

export default MovieList;
